Node.js modularize functions<p>I have two functions, one "calcID" that calculates if a passed demo_id matches the document _id after doing some calculations with MongoDB aggregation framework and mongoose, and another function called "getDemoID" which uses that previous function to get all documents with that calculated ID and then do further processing of documents (e.g log some ID's) ...:</p>

<pre><code>var calcID = function(demo_id) {
    //e.g. demo_id = 928106329281
    var result = FlexPotenzial.aggregate([ 
        {
            $addFields: {
                subID:  {
                    "$eq": [{"$trunc": {"$divide": ["$_id", 1000000]}},+demo_id]
                }
            }
        },
        {
            "$match": { subID : true }
        }   
    ])      
}

exports.getDemoID = function(req,res) {
    calcID(req.params.demo_id, function(err, flPot) {
    flPot =&gt; {
            for (let doc of flPot) {
                console.log(doc.id);
            }           
        }
    }
    ).catch(e =&gt; { console.log(e); res.error(e);});
}
</code></pre>

<p>The problem is, my calcID function is apparently not returning anything, altough I tested the aggregation in mongoose shell and the syntax is correct, but I don't get anything returned when passing the id as url parameter in the route url (get method)...
I would like to modularize my functions a bit more, so I can reuse code that's often repeated...</p>

<p>My question now is, how can I pass the found documents in the aggregation stage to my second function and use them there ? I am quite new to Node or in general javascript styles and I'm not sure what the type of the returned aggregation framework result is... maybe it is not possible at all?</p>

