Mongodb splitting aggregation result<p>I'm currently trying to split an aggregation result in two differents arrays using only mongodb.</p>

<p>My main goal is to create two subset of user with the same distribution regarding the number of interactions that they have made. For this I'm currently making this request: </p>

<pre><code>db.getCollection('Interaction').aggregate([
 { $group : { _id : "$userId", count: { $sum: 1 }}},
 { $sort : { count : -1 }},
 { $group : { _id :{$mod : [_rand() * 2, 2]}, ids : { $push: "$_id"}}}   
}
</code></pre>

<p>My main issue actualy is that the <a href="https://docs.mongodb.com/manual/reference/method/rand/" rel="nofollow noreferrer">_rand()</a> function is called only once during the aggregation execution to I only have all my result in a single array.</p>

<p>Also, a random distribution is not so good. Is there a way to use the index of each result ?</p>

<h1>Edit 1 :</h1>

<p>After @dnickless answer I still got an issue on distribution in the groupBy part. Ideally I would like to do something like this </p>

<pre><code>db.getCollection('Interaction').aggregate([
        { $group : { _id : "$userId", count: { $sum: 1 }}},
        { $sort : { count : -1 }},
        { $bucket: {
                groupBy: { $mod: [ { $indexOfArray : ??? }, 2 ] },
                boundaries: [ 0, 1 ],
                default: 2,
                output: {
                  "users": { $push: "$_id"}
                }
            }
        }
    ],
    { allowDiskUse: true })
</code></pre>

<p>That could split even index and odd index into two separated array. But I would like to apply the <code>$indexOfArray</code> on the current aggregation result.</p>

<p>To give you more context here is my Interaction object model : </p>

<pre><code>{ "_id" : ObjectId("5af01..."), "name" : "WATCH", "date" : ISODate("2018-05-07T09:32:53.219Z") }
</code></pre>

<p>Without the bucket part I have this result : </p>

<pre><code>{ "_id" : "5b1e7f...", "count" : 43.0 } 
{ "_id" : "5b1e75...", "count" : 41.0 } 
{ "_id" : "5b1e7a...", "count" : 40.0 }
...
</code></pre>

<p>I would like my answer to look like this :</p>

<pre><code>{
  { "_id" : 0, "users" : [ "5b1e7f...", "5b1e7a...", ... ] }, // even index results
  { "_id" : 1, "users" : [ "5b1e75...", ... ] }  // odd index results
}
</code></pre>

<p>My end goal is to split my users in 2 groups with evenly distributed numbers of interactions.</p>

<h1>Edit 2 :</h1>

<p>Finally found a solution to resolve my problem : </p>

<pre><code>db.getCollection('Interaction').aggregate([
        { $group : { _id : "$userId", count: { $sum: 1 }}},
        { $sort : { count : -1 }},
        { $group : { _id : "whatever" , user : { $push : { _id : "$_id" , count : "$count"}}}},
        { $unwind : { path : "$user" , "includeArrayIndex" : "rank"}},
        { $bucket: {
                groupBy: { $mod: [ "$rank"  , 2 ] },
                boundaries: [ 0, 1 ],
                default: 2,
                output: {
                  "users": { $push: "$user._id"}
                }
            }
        }
    ],
    { allowDiskUse: true })
</code></pre>

<p>Probably not the most optimized solution at all, but still do the job :)
If you have any advise to improve it I'm still interested in.</p>

