MongoDB with mongoose or SQL<p>I'm a bit new to mongoDB and I'm trying to figure out if I should use MongoDB or to use the familiar SQL.</p>

<p>At first I really wanted to use MongoDB but it's going really slow, and I'm having a hard time how to design my DB and queries.</p>

<p>For instance:
<strong>SQL</strong></p>

<p>Let's say I have these tables:</p>

<pre><code>User Table (Id, Name)

Group (Id, Name)

GroupInvites (UserId, GroupId, Status[A - active, I - invited])
</code></pre>

<p>And if I wanted to know if a player has and group invitations, it would be pretty easy the SELECT and UPDATE from the GroupInvites table.</p>

<p><strong>MongoDB</strong></p>

<p>But in MongoDB the GroupInvites is redundant, because we can have the Status in the group scheme.</p>

<pre><code>const BetGroupSchema = mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    users: [{
        userId: {
            type: mongoose.SchemaTypes.ObjectId,
            ref: 'users',
            required: true
        },
        userStatus: {
            type: String,
            required: true
        }
     }]
})
</code></pre>

<p>But now, if I wanted to SELECT only the groups that a specific user has an invite for, it would be much harder - </p>

<pre><code>Group.find({
    "users.userId": req.user._id,
    "users.userStatus": "I"
}) 
</code></pre>

<p>The result of this would give a all group that have the UserID and all the groups that have UserStatus = 'I'.</p>

<p>And also I can't find a quick way to update the DB directly, If I wanted to update a specific user status to 'A'.</p>

<p>Maybe I got this wrong and someone can show me a good way to implement it in MongoDB or you think it would be better to go with SQL.</p>

